import { render } from "@testing-library/react";
import React, { Fragment } from "react";
import Card from "./card";
import Img from "./img";

class Home extends React.Component {
  render() {
    return (
      <Fragment>
        <img></img>
        <div className="card-group">
          <Card />
          <Card />
          <Card />
          <Card />
        </div>
      </Fragment>
    );
  }
}

export default Home;
